B.Ef=A.a(s(["You're actually looking at it right now, because Octane is the name for my portfolio site. It strikes a fine balance between being professional and adding a personal touch. More than a show-and-tell website for my past coding projects, Octane itself subtly flexes a few brilliant UX-related features that work on a subliminal level.","Ideation for Octane was really a chaotic mess because I just couldn't settle on a design that seemed even half-decent. During the creation of Octane, my personal portfolio site, I encountered numerous challenges which felt impossible to overcome at first. For example, due to my perfectionistic nature, I wanted my portfolio site to be the absolute best of my efforts, both in terms of design and code. I wanted the site's design itself to showcase my skills in order to impress the viewer, but during the ideation stage, I really hit a roadblock. I suddenly seemed to not have any good ideas at all, and even techniques which worked before, such as looking online for inspiration, didn't help me at all now.","Since I still had to move ahead, I settled on a very simple design that I then proceeded to build out. During the process of actually writing code, I felt a bit more free and able to experiment with different designs, which is what finally allowed me to overcome the inspiration block. By trying out different layouts and styles, I was able to come up with a design that I thought was satisfactory.\n\nPushing out an initial version which was far from perfect helped clear my mind, and I was able to focus on \u201cimproving\u201d rather than \u201cperfecting\u201d. In subsequent versions, I was able to implement innovative features such as Hotbox, a neat trick to declutter the site and preserve screen estate, not only keeping navigation controls one click away, but also allowing the content within view to be searched, filtered, and sorted.\n\nAdditionally, Tandem-Rendered UI (TRUI) slowly reveals UI elements such as buttons, cards, and text instead of loading all of them at once. By intelligently only rendering elements when the user needs them, TRUI lends a predictive feel to the overall website, making it truly come alive.\n\nTogether with beautiful hand-drawn art and animations being weaved into the site, Octane was slowly starting to exceed my expectations."]),t.s)
