B.Fq=A.a(s(["The Affogato Project explores an end-to-end language development framework. From implementing a parser and an interpreter to static analysis and IDE support, Affogato aims to streamline the process of creating custom programming languages using Dart as the target language of transpilation. Along the way, the Affogato Editor was also conceived in order to supply the Flutter community with an out-of-the-box substitute Widget for Microsoft's ","@link{{https://github.com/microsoft/monaco-editor},MonacoEditor}",".","I was always interested in creating my own programming languages and have tried many different methods based on YouTube videos. The one that worked best for me was the structured step-by-step guide ","@link{{http://craftinginterpreters.com},craftinginterpreters.com}"," by Robert Nystrom. What I realised however, was that much of the process involved in bringing a new language to life was different manifestations of the same syntactic rules. At the same time that I came up with my first full-fledged programming language, I was also working on The Lighthouse Project, which needed a custom scripting language for superusers to perform operations in the app quickly.\n\nInitially, the implementation for that language was a Finite State Machine (FSM), but due to some programming errors, it became more of an uncertain state machine. After building out a full-fledged interpreter for the language, I was ready to give myself a pat on the back, when I realised that users still could not use the scripting language since it lacked a lot of language support, such as syntax highlighting, auto-complete, and static analysis. Heck, there wasn't even a proper code editor widget available on ","@link{{https://pub.dev},pub.dev}","! I then got to work designing a code editor that finally had all the bells and whistles of Monaco Editor, and the rest is history.","From its inception in end-2023 to its first stable release in 2024, Affogato is one of my most favourite mini-projects."]),t.s)
B.Ek=A.a(s(["AffogatoCore, a Dart library to build an end-to-end language framework","Affogato Editor, a web app that provides an editor and IDE tooling for languages designed in Dart"]),t.s)
B.Fs=A.a(s(["Given my prior experience with creating programming languages (all those weeks of creating a programming language with just the Crafting Interpreters book by Robert Nystrom open in a Safari tab), I knew that the programming language would be composed of:","- a tokeniser","- a parser","- an interpreter","- optionally, a core library","After research on ","@link{{https://code.visualstudio.com/api/language-extensions/overview},bringing a new language to VSCode}",", the following components also became necessary:","- a TextMate theme file for syntax highlighting","- an ","@link{{https://microsoft.github.io/language-server-protocol/},LSP server}"," for static code analysis","My goal with Affogato was to unify the whole process into a single Dart package, so that simple languages could be shipped effortlessly. Another benefit of using Affogato to create a programming language would be the seamless integration with the Affogato Editor. The Affogato Editor provides support for many languages (such as Markdown), as well as many features (such as bracket matching and auto-indentation) out-of-the-box.","I created the editor first, by creating a giant `TextField`, and controlling the display by rendering custom-decorated `TextSpan`s in the field. Next, I set up boilerplate code for a generic interpreter framework, and used that to build a Markdown interpreter. With that, I was able to work on the integration between language and editor.\n\nAdding theme support was easy, as I ported over the basic yet effective method of mapping AST nodes to scope names, and scope names to text styles. A package on ","@link{{http://pub.dev},pub.dev}","known as `highlight` was basically the Dart equivalent of `highlight.js`, so I used that to provide generic syntax highlighting for languages which did not have interpreters written in Dart.\n\nCurrently, I am working on making the editor more performant, by triggering a re-parse on only the sections of code which have been edited, instead of the entire document."]),t.s)
