B.FJ=A.a(s(["The Hyperion Project is a megaproject that I started to explore the field of autonomic computing. At the time of writing in 2023, autonomic computing was a relatively new topic, just about ten or so years old. There were many studies about sub-topics in autonomic systems, such as AI/ML, distributed systems, and observability. However, research papers on the topic itself were scarce, so I wanted to kickstart R&D in this field.\n\nWhy autonomic computing? Well, I've always thought about the possibility of self-managed systems since I was a wee lad, but never once did I imagine that it was an actual area of research. After finding out that it indeed was, and that developments in the field of AI/ML are bringing us ever closer to that vision, I could not wait to start tinkering with code and conducting independent research on the subject.\n\nI also write about my journey of researching this field on my blog, Letterpress. For example, check out ","@link{{https://letterpress-project.web.app/#/blogules/enter_autonomic_computing},this} article.","From its inception in 2023, The Hyperion Project is the second of my two flagship projects."]),t.s)
B.EX=A.a(s(["Through this project, I aim to collate my understanding of the field and conduct a few experiments to explore some ideas I might have. Based on my research and that of other more experienced and knowledgeable computer scientists, I also hope to be able to develop a few tools to enable autonomic computing in the cloud. The end result, I hope, is a toolkit similar to cloud platforms that streamlines the process of migrating, developing, debugging, and maintaining an autonomic system.\n\nAnother key deliverable from this project would be Vabrian, a community-based R&D tool that allows the masses to collaboratively contribute ideas, experience, and experimental results to investigate various research questions."]),t.s)
B.Ff=A.a(s(["This project is still in progress, but it allowed me to explore the more research-y side of computer science. Until now, I have carried out experiments in school using the scientific methodology, and written reports explaining whether a certain research question has been met or not, but this is the first time I\u2019ve had to pick an appropriate research question in an unfamiliar topic.\n\nI do find it quite tough, though, because the field is so very vast and there are numerous ways to start investigating different parts of an autonomic system, so I am still unsure of where/how to start. This uncertainty has impeded my progress in this project quite significantly, as I was constantly second-guessing every step that I take, and without any supervisor to guide me, it was starting to feel like a mammoth task.\n\nFor example, I had spent the latter half of 2023 writing a lengthy article on autonomic system architectures, but I soon started to wonder if that was indeed the best way to approach the task. I tried writing shorter papers on more specific sub-topics such as computer-addressable knowledge and policy/goal representation, but I couldn\u2019t shake off the nagging feeling that there was already some research out there that covered the same topic at a greater breadth or depth.","Then I chose instead to start with a bare-bones system and add autonomic features to it, in the hopes that I would end up looking into more pragmatic areas of concern. Starting with a sample ","@link{{https://github.com/Infinitum-Hyperion/Research-Cases/tree/main/xpress},blogging website}",", I tried to incrementally give it autonomic features, but without any prior research, I was very much scoped into the solution I had in mind, and could not think of any alternatives during each step of the autonomicity-adding phase. At the turn of the year, however, I finally managed to get a decent grasp of what I wanted to do.\n\nStarting first with a literature review to gain an overview of topics within the field, I decided to start with the more macro considerations \u2014 such as architecture and paradigms \u2014 before delving deeper into each micro concern \u2014 such as knowledge representation and adaptation at runtime. This gave me not only a sense of clarity and focus, but also renewed motivation, and I find that the process of researching has become very enjoyable once again. Using mind maps and more freeform tools to collate ideas and diagrams proved to be useful as well:","@img{{thp_archs_brainstorm}}","But The Hyperion Project is more than just research about autonomic computing, the end objective is to create a platform with which autonomic systems can be built. Hence, I also had to think about how my approach to the business solution would be shaped from an end-user perspective:","@img{{hyperion_codebase_overview}}","However, the suite of tools offered and the approach to developing an autonomic system depended heavily on the research I conducted, and that is why I am currently researching the possible architectures for an autonomic system. From that point onwards, I will shift my approach from passive research-and-report articles to a documentation of my experience with trying to implement the chosen architecture(s) concretely."]),t.s)
