B.ER=A.a(s(["Inspired by the book ","@link{{https://gettingthingsdone.com/what-is-gtd/},Getting Things Done: The Art of Stress-free Productivity}"," by David Allen, I tried implementing a rigorous productivity system using the tools I had available at the time. After jumping between Asana, Trello, Jira, Notion, Google Calendar, Apple Reminders, etc., I realised that each tool offered its own strengths and weaknesses. 108 iOS Shortcuts scripts later, I also discovered that integrating them all together was extremely difficult as well. A tool is needed that is free, that offers a diverse and customisable set of features, and that reduces administrative workload as well.\n\nIn the Lighthouse Project, my main focus is the Lighthouse web app \u2014 a powerful all-in-one, free-forever tool that helps you organise the various sectors of your life in a sustainable manner. The focus of the web app is to be \"intelligent\", automating as much of the administrative work as possible so that you can focus on actually completing your tasks. The web app is so feature-rich that I've also compiled a repository of documentation that guide the user through using different features of Lighthouse at different levels of depth. From bird's-eye-view for beginners to detailed feature-specific guides for the superusers, the documentation caters to users of all backgrounds. Further, elaborate guides detailing the design process and development decisions also make it easy for other developers to understand how Lighthouse came into being, allowing them to also improve on the product if needed.\n\nBased heavily upon the GTD methodology and the modern-day concerns of implementing the GTD system, Lighthouse aims to revolutionise personal productivity.","From its inception in 2021 to its first stable release in 2024, the Lighthouse Project is the first of my two flagship projects."]),t.s)
B.FB=A.a(s(["The final product, the Lighthouse web app, is in private beta release now, undergoing testing by a  professional UI/UX design team. The app stores data locally for now, not only to make it free, but also to make development and innovation of new ideas easier.\n\nOnce more collaboration features are involved, I plan to utilise cloud databases in order to implement related features."]),t.s)
B.EV=A.a(s(["With Lighthouse, I was already very clear on the exact solution I wanted to implement, so the only research I did was a market analysis to summarise all the features offered by major players in the field, such as Asana, Jira, Trello, Notion, and the likes.\n\nOnce I confirmed the features Lighthouse would offer, I started designing the user experience first. I thought about how information would be presented and manipulated, used and processed. This involved brainstorming new models for the interface and how the user would access the app.","@img{{figjam_launchcontext_brainstorm}}","@img{{sprint_planning_steps}}","While it was easy to envision a seamless user experience where the app could almost read the user\u2019s mind, translating the experience into an interface proved to be a challenge for me. This is because one of the key selling points of the app would be to reduce administrative load on the user, but if the user was always constantly reading documentation to try and figure out how to use the app, the objective would not be achieved. To achieve a balance between usability and feature-packedness, Lighthouse had to go through 4 major UI overhauls. Each overhaul introduced new concepts, layouts, and design guidelines that made the design system more maintainable and effective as well.","@img{{inputfieldcontroller}}","Lighthouse also experiments with a highly maintainable architecture to combine the backend to the frontend by maximising code reusability. However, this does come at the cost of increased time taken to design the system and iterate with failed prototypes.","@img{{storable_arch}}"]),t.s)
